    "2016-11-25T21:06:29.686397",nt"name": "national-longitudinal-transition-study-2",nt"isopen":
    true,nt"url": null,nt"notes": "The National Longitudinal Transition Study-2
    (NLTS2) is a study that is part of the National Longitudinal Transition Study (NLTS)
    program; program data is available since 2000 at <http://ies.ed.gov/ncser/pubs/index.asp#nlts2>.
    NLTS2 (http://ies.ed.gov/ncser/projects/nlts2) is a longitudinal survey that was
    designed to provide a national picture of the experiences and achievements of students
    in special education during high school and as they transition from high school
    to adult life. NLTS2 involved five waves of data collection using three main data
    collection components: (1) telephone interviews with parents and youth who are capable
    of completing a phone interview; (2) direct assessments and in-person interviews
    with youth while they are in secondary school; and (3) the collection of school
    data (e.g., surveys of teachers, special education teachers, principals). A nationally
    representative sample of students who were 13 to 16 years old and receiving special
    education services in December 2000 when the study began were sampled, and these
    students were followed until 2010. Key statistics produced from NLTS2 are characteristics
    of secondary school students in special education and their households; secondary
    school experiences of students in special education, including their schools, school
    programs, related services, and extracurricular activities; experiences of students
    once they leave secondary school, including adult programs and services, social
    activities, etc.; and measurement of the secondary school and postschool outcomes
